import unittest

import algabra.algorithms.strings as mystr


class IsValidTestCase(unittest.TestCase):

    def test_long_string(self):
        str = ''
        result = mystr.is_valid(str)

        assert result


class SpecialAnagramTestCase(unittest.TestCase):

    def test_anagram_string(self):
        result = mystr.anagram_count(5, 'asasd')

        assert result


class LCSTestCase(unittest.TestCase):

    def test_lcs_count(self):
        result = mystr.longest_common_subsequence('SHINCHAN', 'NOHARAAA')

        assert result


class FindEncodingsTest(unittest.TestCase):

    def test_find_encoding_test1(self):
        encodings = mystr.Encodings()
        result = encodings.find_encodings(1234)

        assert result == 3

    def test_find_encoding_test2(self):
        encodings = mystr.Encodings()
        result = encodings.find_encodings(111)

        assert result == 3

    def test_find_encoding_test3(self):
        encodings = mystr.Encodings()
        result = encodings.find_encodings(1111)

        assert result == 5

    def test_find_encoding_test4(self):
        encodings = mystr.Encodings()
        result = encodings.find_encodings(111127)

        assert result == 8

    def test_find_encoding_test5(self):
        encodings = mystr.Encodings()
        result = encodings.find_encodings(5)

        assert result == 1


if __name__ == '__main__':
    unittest.main()
